script: |
  super -f tsv -I q10080.sql | sort > q10080.out

vector: true

inputs:
  - name: q10080.sql
    data: |
      SELECT ALL NULLIF ( + CASE 5 WHEN - cor0.col1 THEN cor0.col1 + cor0.col1 END, + col2 ) * col1 + cor0.col1 FROM tab0 AS cor0 GROUP BY cor0.col1, cor0.col2;
  - name: tab0

outputs:
  - name: q10080.out
    data: |
      NULL
      NULL
      NULL
